import React, { useEffect} from 'react'
import './styles/App.css';
import axios from "axios";
import Loader from "./Loader";
import Modal from "./Modals/Modal"
import MainHeader from "./Components/Visuals/MainHeader";
import async from "async";

function App() {
    const [items, setItems] = React.useState(  [])

    useEffect(() => {
        fetch("http://localhost:8080/prometheus/fxspot/getAll")
            .then(response => response.json()).then(data => console.log(data))
            .then(data => setItems(data));
    }, []);

    const listItems = items.map((d) => <ul className="itemsUl"><li className="itemsLi" key={d.id}>{d.id}</li>
        <li className="itemsLi" key={d.id}>{d.name}</li>
        <li className="itemsLi" key={d.id}>{d.spotRate }</li>
    </ul>);

    return (

        <div className="wrapper">

            <div className="sidebar">
                <div>
                    <MainHeader/> &nbsp;
                    <button className="start">
                        Start!
                    </button>
                    &nbsp;
                    <Modal items = {listItems}/> &nbsp;
                    {listItems}

                </div>
            </div>
            <div className="main-slide">
                <div className="bg">

                </div>
            </div>

        </div>
    );
}

export default App;
